import React from "react";
import { Box, Divider, Typography } from "@mui/material";
import UserImg from "components/UserImg";
import PersonAddIcon from "@mui/icons-material/PersonAdd";
import WidgetContainer from "components/WidgetContainer";
import EditIcon from "@mui/icons-material/Edit";
import FlexBetween from "components/FlexBetween";
import EmojiTransportationIcon from '@mui/icons-material/EmojiTransportation';const UserWidget = () => {
  const addFriend = () => {
    alert("add");
  };
  return (
    <WidgetContainer>
      <Box p="1rem">
        <Box display="flex" pt="100px">
          <UserImg />
          <Box>
            <Box>userName</Box>
            <Box>_friends</Box>
          </Box>
          <PersonAddIcon
            sx={{ fontSize: "1.3rem", color: "grey" }}
            onClick={addFriend}
          />
        </Box>
        <Divider />

        <Box>
          <Box>
            <LocationOnIcon sx={{ fontSize: "1.3rem", color: "grey" }} />
            Location
          </Box>
          <Box>
            <LocationOnIcon sx={{ fontSize: "1.3rem", color: "grey" }} />
            Company
          </Box>
        </Box>
        <Divider />

        <Box>
          <Typography variant="subtitle2">Social Profiles </Typography>
          <FlexBetween>
            <img width={"24px"} src="/assets/twitter.png" alt="" />
            <Box>Twitter</Box>
            <EditIcon sx={{ color: "grey", fontSize: "1.2rem" }} />
          </FlexBetween>
          <FlexBetween>
            <img width={"24px"} src="/assets/linkedin.png" alt="" />
            <Box>LinkedIn</Box>
            <EditIcon sx={{ color: "grey", fontSize: "1.2rem" }} />
          </FlexBetween>
        </Box>
        <Divider />
      </Box>
    </WidgetContainer>
  );
};

export default UserWidget;
